import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import strings from "./strings";
import "./styles.css";

const carouselItemArr = [
  {
    headline: "Headline",
    description: "Description",
  },
  {
    headline: "Headline",
    description: "Description",
  },
];

const items = carouselItemArr.map((details, i) => {
  return (
    <div
      key={i}
      style={{ height: 200, width: "100%", backgroundColor: "pink" }}
    >
      <div>Title</div>
      <div>Paragraph</div>
    </div>
  );
});

export default () => (
  <Carousel
    autoPlay
    showStatus={false}
    showThumbs={false}
    infiniteLoop={true}
    style={{ height: 200, width: "100%" }}
  >
    {items}
  </Carousel>
);
